import React from 'react';
import './menu.scss'
import Button from '@material-ui/core/Button';


function Menu(props) {
    return (
        <div className="Menu">
            <div className="menu__btn-">
                <Button variant="contained" color="primary">
                    Primary
            </Button>
            </div>
        </div>
    );
}

export default Menu;
